import base64
from typing import List

# BOF imports
from core.gunnershell.bofs.base import Bof, register

from colorama import Style, Fore
brightgreen = "\001" + Style.BRIGHT + Fore.GREEN + "\002"
brightyellow = "\001" + Style.BRIGHT + Fore.YELLOW + "\002"
reset = Style.RESET_ALL

@register("getintegrity")
class GetIntegrityBof(Bof):
	base64bof: str = ""
	x86base64bof: str = ""
	

	def help_menu():
		menu = """
Queries the current process token and reports its Windows integrity level.
Output is one of: Untrusted, Low, Medium, Medium+, High, System, or Protected (for PPL).
This helps quickly verify elevation/UAC context and whether you’re running with High/System or a restricted token.

Usage: bofexec getintegrity

Notes:
  “Medium+” indicates a filtered admin token with UIAccess or similar.
  “Protected” appears for Protected Process / PPL scenarios.
  On AppContainer processes you’ll typically see Low (with additional AppContainer SIDs not shown here).
"""
		print(brightgreen + menu + reset)
		return